import PropTypes from 'prop-types';
import { Table } from './ContactList.styled';

export const ContactsList = () => {
  const contactList = [];
  return (
    <Table>
      <tbody>
        {contactList.map(contact => {
          return (
            <tr key={contact.id}>
              <td>{contact.name}</td>
              <td>{contact.number}</td>
              <td>
                <button onClick={() => (contact.id)}>
                  Delete
                </button>
              </td>
            </tr>
          );
        })}
      </tbody>
    </Table>
  );
};
